import React from 'react';
import "./explore.css";
import DiscoverLogo from '../../../src/assets/discover-logo.svg';
import {
    Container,
    Row,
    Col,
  } from 'react-bootstrap';
const Explore=()=>{
    return(
        <Container fluid="md">
        <Col>
        <Row sm={3} className="text-center justify-content-center align-items-center"><img className="" src={DiscoverLogo} alt="React Logo" /></Row>
        <Row sm={3}>sm=3</Row>
        <Row sm={6}>sm=6</Row>
        </Col>
      </Container>
    )
}

export default Explore;
